1.具有1年Java后台开发经验，有前台开发经验优先，作为核心人员参与过两个以上软件项目开发;
2、熟悉SpringBoot，SpringCloud，MySQL，Javascript，具备基本前台开发经验;
3、具有强烈的求知欲和上进心，有强烈学习进步意愿者优先。

工作内容:
1.从事Java后台和前台开发;
2.设计软件模块架构并开发测试;
3.进行软件代码的维护和改进工作;
4.实现个人和团队快速成长。

职位福利
1、优越的高校环境和资源，与入选国家海外杰出人才和浙江省特聘专家的教授和优秀的博士后，博士，硕士生共同学习工作；
2、提供处于全球领先地位的能源互联网方面的开发技术和在国家科技部基金委和知名企业支持下的下一代智慧技术的研究与学习机会。
3、提供浙江大学系统内住房条件，五险一金等；
4、提供等同浙大教职工的娱乐设施，图书馆，体育馆和食堂等资源；
5、提供极佳的个人技术和能力成长环境，表现优异者有机会获得留在课题组继续攻读学位的资格。
